import React from 'react';
import { View, Text } from 'react-native';

export default function SecondScreen() {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>This is the second screen!</Text>
    </View>
  );
}
